webpackJsonp([26335516371117],{1880:function(e,A){e.exports={data:{markdownRemark:{html:'<p>If you are chasing the perfect skincare routine like most Korean girls, then one important step that you can’t miss is the essence. So what is Korean essence? Many people mistake it with the serum, so these are the differences: essences in Korea are watery, so they should be patted on your face after toner (usually called skin in Korea); thicker than serum but they both contain high concentrations of active ingredients. Anyway, today my topic is about Innisfree Soybean Energy Essence 150ml. It is sold at 35,000krw (~$35), but I got it when the brand offers 30% discount so it was just 24,500krw (~$24). I bought it at the store, but it’s also available online.</p>\n<figure style="width: 400px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/innissoybean-1-0f74920743dc4ae2ff2fd66f55d268b4-65f4a.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 960px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 138.95833333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="innissoybean 1" title="" src="/static/innissoybean-1-0f74920743dc4ae2ff2fd66f55d268b4-65f4a.png" srcset="/static/innissoybean-1-0f74920743dc4ae2ff2fd66f55d268b4-2c3de.png 300w,\n/static/innissoybean-1-0f74920743dc4ae2ff2fd66f55d268b4-bcff7.png 600w,\n/static/innissoybean-1-0f74920743dc4ae2ff2fd66f55d268b4-65f4a.png 960w" sizes="(max-width: 960px) 100vw, 960px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>For those who are not familiar with Innisfree, it is a naturalism-oriented cosmetics brand created by Amore Pacific in 2000. It is also one of the few Korean brands that use organic ingredients certified by France\'s ECOCERT organization. The essence is packed in a 150ml bottle of translucent color, very cute, the outer paper box looks simple as well. The bottle is very handy and I love it.</p>\n<p>Innisfree claims that this is an essential anti-aging essence with fermented oil and high concentrated Jeju fermented soybean extract for healthy skin with a natural glow.</p>\n<ul>\n<li><strong>91% fermented Jeju soybean extract gives skin energy and resilience</strong></li>\n</ul>\n<p>The enriched gamma-PGA from fermented Jeju soybeans, grown at an elevation of 2,034 ft. on Mt. Halla, help build a firm and dense skin barrier to help your skin fight against environmental and natural damage.</p>\n<ul>\n<li>**6-in-1 rejuvenating skin care essence **</li>\n</ul>\n<p>This essence removes impurities for smoother skin, provides your skin with elasticity and brightens and revitalizes your skin tone. Its 6 types of skincare functions strengthen your skin barrier and make the skin healthier.</p>\n<figure style="width: 300px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/innissoybean-2-818b9a8377d2ef441f067efed3588a9c-51342.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 586px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 102.3890784982935%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="innissoybean 2" title="" src="/static/innissoybean-2-818b9a8377d2ef441f067efed3588a9c-51342.png" srcset="/static/innissoybean-2-818b9a8377d2ef441f067efed3588a9c-5aa0e.png 300w,\n/static/innissoybean-2-818b9a8377d2ef441f067efed3588a9c-51342.png 586w" sizes="(max-width: 586px) 100vw, 586px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption style="font-size: 17px" align="center"> <span style="color:olive"> The design is very convenient to use </span> </figcaption>\n</figure>\n<h2 id="span-stylecolorblueviolet-ingredients-span"><a href="#span-stylecolorblueviolet-ingredients-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:blueviolet"> Ingredients </span></h2>\n<p>Formulated with naturally fermented collagen activators™</p>\n<p>The natural fermentation factor™ from fermented soybeans rejuvenates skin to restore its natural resilience.</p>\n<figure style="width: 500px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/innissoybean-3-5fd86646864958d12a5fb3d32199fe3a-c5d03.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 331px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 40.483383685800604%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="innissoybean 3" title="" src="/static/innissoybean-3-5fd86646864958d12a5fb3d32199fe3a-c5d03.png" srcset="/static/innissoybean-3-5fd86646864958d12a5fb3d32199fe3a-c102d.png 300w,\n/static/innissoybean-3-5fd86646864958d12a5fb3d32199fe3a-c5d03.png 331w" sizes="(max-width: 331px) 100vw, 331px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<h2 id="span-stylecolorblue-how-to-use-span"><a href="#span-stylecolorblue-how-to-use-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:blue"> How to use </span></h2>\n<p>After washing your face, soak a cotton pad (you can use your hand if lazy) with essence and wipe it around your face, avoiding your eyes and mouth.</p>\n<figure style="width: 500px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/innissoybean-4-988c87c376c79d254634211256f6e1a3-b4874.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 1038px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 55.78034682080924%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="innissoybean 4" title="" src="/static/innissoybean-4-988c87c376c79d254634211256f6e1a3-b4874.png" srcset="/static/innissoybean-4-988c87c376c79d254634211256f6e1a3-5ef72.png 300w,\n/static/innissoybean-4-988c87c376c79d254634211256f6e1a3-e0f63.png 600w,\n/static/innissoybean-4-988c87c376c79d254634211256f6e1a3-b4874.png 1038w" sizes="(max-width: 1038px) 100vw, 1038px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>When I apply it, I feel a little bit sticky on my face since this essence is thicker than the toner. But don’t worry, due to the watery texture (photo above), it absorbs really fast so you won’t be bothered. Besides, it makes <strong>my skin so smooth and soft after use</strong>. For a long term using, my skin (combination to dry type) doesn’t feel dry anymore. This essence doesn’t have a scent as well. Very nice product for even sensitive skin. For the anti-wrinkle effect, I noticed that <strong>my skin is lifted</strong> (I think it requires using for a long time). But for whitening, I see nothing. Since my skin tone is not a big problem, I just skip it.</p>\n<p>Overall, I like this essence of Innisfree. It does a good job of moisturizing and soothing my skin or even anti-wrinkle. Do I purchase again? Let me think…If I find a better essence at that cheap price, I will change, other else, I will continue using it.</p>\n<p>So if you have any suggestions for the essence, pls let me know ^^</p>',timeToRead:3,excerpt:"If you are chasing the perfect skincare routine like most Korean girls, then one important step that you can’t miss is the essence. So what…",frontmatter:{title:"Review - Innisfree Soybean Energy Essence",cover:"/images/in1.png",date:"2016/05/05",category:"Beauty",tags:["Beauty","innisfree","soybean-energy-essence","korean-cosmetic","skin-care","innisfree","tinh-chat-duong-dau-nanh","my-pham-han","duong-da"]},fields:{slug:"/en/Review-Innisfree-Soybean-Energy-Essence/"}}},pathContext:{path:"/en/Review-Innisfree-Soybean-Energy-Essence/",langKey:"en"}}}});
